import { useState } from "react";

import {
  LineOne,
  LineThree,
  LineTwo,
  Logo,
  NavList,
  MenuIcon,
  Nav,
} from "../styles/layout/Nav.styled";

export const NavBar = () => {
  const [menuOpen, setMenuOpen] = useState(false);

  return (
    <>
      <Nav>
        <div>
          <a href="#hero-section">
            <Logo src="./images/logo.png" />
          </a>
        </div>
        <MenuIcon>
          <LineOne menuOpen={menuOpen} />
          <LineTwo menuOpen={menuOpen} />
          <LineThree menuOpen={menuOpen} />
        </MenuIcon>
        <NavList>
          <li>About</li>
          <li>Services</li>
          <li>Menu</li>
        </NavList>
      </Nav>
    </>
  );
};
